import '../C_dashboard/style_dashboard.css';
import NavBar from '../C_dashboard/NavBar';
import Profile from '../C_dashboard/Profile';
import Feed from '../C_dashboard/Feed';
function Dashboard() {
  
  return (    
    <div class="cols">             
      <NavBar menubar_option="feed"/>                        
      <div class="rows">
        <Profile 
          userprofile_path="rms\src\C_dashboard\user_profiles\AU1841139.jpeg" 
          user_name="Khushi Shah"
          user_rollno="AU1841131"
          userprofile_about="STUDENT" 
          user_school="School of Enginnering and Applied Science" 
          user_degree="Bachelor in Technology in Information and Communication Technology"
        />     
        <Feed/>
      </div>
      
    </div>  
  );
}

export default Dashboard;
